import React, { useState, useEffect } from "react";
import "./styles/summary.css";

const Summary = ({}) => {
  return (
    <div>
      <div className="summary">
        <div className="win">
          <p>Total win</p>
        </div>
      </div>
      <div className="win">
        <p>Total win</p>
      </div>
      <div className="loss">
        <p>Total Loss</p>
      </div>
    </div>
  );
};

export default Summary;
